def generate_visit_order(n, m):
    if n * m >= 10 ** 6:
        return -1
    ans = []
    if n % 2 == 0:
        for i in range(n // 2):
            for j in range(m):
                ans.append((i + 1, j + 1))
                ans.append((n - i, m - j))
    else:
        for i in range(n // 2):
            for j in range(m):
                ans.append((i + 1, j + 1))
                ans.append((n - i, m - j))
        mid = n // 2
        for j in range(m // 2):
            ans.append((mid + 1, j + 1))
            ans.append((mid + 1, m - j))
        if m % 2 != 0:
            ans.append((n // 2 + 1, m // 2 + 1))
    return ans

